import React from 'react';
import Screen from './app/components/Screen';
import Icon from './app/components/Icon';
import ListItem from './app/components/ListItem';


const  App = () => {
  return (
    <Screen>
      <ListItem title="My title" subTitle="My subtitle"/> 
    </Screen>
  );
}
export default App;
